void Analysis::loadFile(std::string path)
{
    qDebug()<<QString("File opened ");
    qDebug()<<QString::fromStdString(path);

}

void Analysis::sendEcgBaselineConfig(EcgBaselineConfig)
{

      EcgBaselineConfig ecgBaselineConfig3;

      if(ecgBaselineConfig3.algorithm == EcgBaselineConfig::Algorithm::WAVELET)
      {qDebug()<<QString("The ECG detection method was choosen W");}
      else if (ecgBaselineConfig3.algorithm == EcgBaselineConfig::Algorithm::BUTTERWORTH)
      {qDebug()<<QString("The ECG detection method was choosen B");}

}

void Analysis::sendRPeaksConfig(RPeaksConfig)
{
    RPeaksConfig rPeaksConfig3;

    if(rPeaksConfig3.algorithm == RPeaksConfig::Algorithm::HILBERT)
    {qDebug()<<QString("The R-Peaks detection method was choosen H");}
    else if (rPeaksConfig3.algorithm == RPeaksConfig::Algorithm::PAN_TOMPKINS)
    {qDebug()<<QString("The R-Peaks detection method was choosen T");}

    qDebug()<<QString("Sending also sample frequency");

}

void Analysis::sendHrv2Config(Hrv2Config)
{
    qDebug()<<QString("The HRV2 num_of_bins was choosen");
}


